import React from 'react'
import Game from '../Game'
import { GamingList } from '../../utils/data'



const GamesList = (props) => {
  const {GamingList} = props
    return (
      <div id="list">
        {GamingList.map((game) =>
          <Game name={game.name} mode={game.mode} genre={game.genre} img={game.img} />
        )}
          </div>
    )

}

export default GamesList
